import "./NewItemPage.css";

function NewItemPage() {
	return (
		<div className="NewItemPage">
			<div className="Image">
				<img
					className="Image"
					src="https://m.media-amazon.com/images/I/71BnqTCnBRL._AC_UX679_.jpg"
					alt="Italian Trulli"
				/>
			</div>
			<div className="Iteminfo"></div>
		</div>
	);
}

export default NewItemPage;
